/* volume (dynamics) values:
 * fff = 127
 * ff = 113
 * f = 98
 * mf = 84
 * mp = 71
 * p = 61
 * pp = 39
 * ppp = 20
 */

// define the Note structure
// negative numbers in the name variable:
// -1 marks the end of a piece
// -2 signals for fading all channels
// -3 signals for a change in tempo
// -4 singals for a change in play time, used to lengthen/shorten sections or repeat bars
struct Note
{
	int name;
	int time;
	int volume;
	bool toplay;
};

